import {Container, Cardprof, CardInfo} from './style';
import card2 from '../../img/card2.png';


export default function GridAtv(){
    return(
        <Container>
            <Cardprof>
            <img src={card2}/>
            
            </Cardprof>
           
        </Container>
    );
}
